          var re = self.buildModClassRe().exec(className);
          var modName = re[1].split(self.config.modDlmtr);

          if (modName[1] !== undefined && modName[1] !== false) {
            modVal = modName[1];
          } else {
            modVal = true;
          }

          result[ modName[0] ] = modVal;
